"date": "1731-01-02",
"tags_section": "Es werden zum Verkauff offeriert",
"text": "21. Bey Hrn. Jacob Grimm Buchbinder ist zu haben: 1) Ein Kriegs-Atlas von 65 theils Land-Karten, Städten, Plans von Bataillen und Belagerungen des jetzigen Kriegs. 2) Die Welt in einer Kuh mit Kupfern. 3) Die Durchlauchtige Welt, 4 Theil mit Waapen. 4) Journal du Camp de Compiegne avec figures."
},
{
"date": "1731-01-02",
"tags_section": "Es werden zum Verkauff offeriert",
"text": "22. Zwei saubere französische Better in ein Wirthshaus auf das Land oder in ein Bad dienlich, ohnentgeldlich im Berichtshaus zu erfragen."
