},
{
"date": "1731-01-02",
"tags_section": "Es werden zum Verkauff offeriert",
"text": "24. Ein Freund, welcher circa 600 Seifer Hanf-Saamen anhero liefern könnte, möchte aber solchen vorhero verkauft wissen, offeriert selbigen dahero in billigem Preis, im Berichtshaus zu erfragen."
},
{
"date": "1731-01-02",
"tags_section": "Es werden zum Verkauff offeriert",
"text": "25. Wo guter alter weisser Wein zu haben, ist bey Mtr. Michael Zuchß den Kuefer zu vernehmen."
},
{
"date": "1731-01-02",
"tags_section": "Es werden zum Verkauff offeriert",
"text": "26. Circa 6. Saunt extra guter alter pur rother Fdseiner-Wein, so gut als Neuenburger oder Burgunder, in billigem Preis, im Berichtshaus zu erfragen."
},
{
"date": "1731-01-02",
"tags_section": "Es werden zum Verkauff offeriert",
"text": "27. Zwei Stücklein weissen Wein von 1760. à 8 Pfund 10 s der Saunt im einten, und à 8 Pfund im andern, wovon nach Belieben zu haben, im Berichtshaus ohne Entgeld zu erfragen."
},
{
"date": "1731-01-02",
"tags_section": "Es werden zum Verkauff offeriert",
"text": "28. Ein Stock Heu ab 3 Thalen Matten vorn Riechemer, Thor oberhalb der Schwenbruck. Ferner ein Stücklein von 7 Sammen rothen Völliger-Wein von 1760. schön roth und lauter, im Berichtshaus ohne Entgeld zu erfragen."
},
{
"date": "1731-01-02",
"tags_section": "Es werden zum Verkauff offeriert",
"text": "29. Auf C. E. Junst zum Bären sind wiederum neue Saure Rüben in billigem Preis zu haben."
},
{
"date": "1731-01-02",
"tags_section": "Es werden zum Verkauff offeriert",
"text": "30. Ein roth Scharlachen Camisol und Hosen in billigem Preis, im Berichtshaus zu erfragen."
},
{
"date": "1731-01-02",
"tags_section": "Es werden zum Verkauff offeriert",
"text": "31. Im Offenburger Hof ist wohlverwahrter Bau zu haben."
},
{
"date": "1731-01-02",
"tags_section": "Es werden zum Verkauff offeriert",
"text": "32. Ein Brennhausklein bey der Steinen-Mühlin mit aller Kommlichkeit, im Berichtshaus ohne Entgelt zu erfragen."
},
{
"date": "1731-01-02",
"tags_section": "Es werden zu Entleihen begehrt",
"text": "33. Bey weme rother und weisser Burgunder, wie auch Muscat-Wein, Piceenweid wegen Mangel Vlages, wie auch roth und weißer 1753ger Margräfer-Wein in billigem Preis zu haben, ist im Berichtshaus ohne Entgeld zu erfragen."
},
{
"date": "1731-01-02",
"tags_section": "Es werden zu Entleihen begehrt",
"text": "34. Keine heitergelbe Hamburger-Strick-Wollen das Pfund à 6 Pfund, wo dieselbe Pfundweid zu haben, ist im Berichtshaus ohne Entgeld zu erfragen."
},
{
"date": "1731-01-02",
"tags_section": "Es werden zu Entleihen begehrt",
"text": "35. Heren Hofschach des Siegriffs Behausung ins Spieg-Idgklein mit 4 Stuben, 3 Kammern etc. ist entweder zu verkaufen, oder famethaft zu verleihen."
},
{
"date": "1731-01-02",
"tags_section": "Es werden zu Entleihen begehrt",
"text": "36. Weisse und rothe Margräfer-Weine von 1760. wovon in billigem Preis nach Belieben zu haben, im Berichtshaus zu erfragen."
},
{
"date": "1731-01-02",
"tags_section": "Es werden zu Entleihen begehrt",
"text": "37. Ein Mannensitz in St. Peters Kirch auf dem Letner. Item ein grün Tombrau-Betklein mit grünen wollsten Umhängen, in billigem Preis, im Berichtshaus zu erfragen."
},
{
"date": "1731-01-02",
"tags_section": "Es werden zu Entleihen begehrt",
"text": "38. Ein Hausschlitzen mit einem schönen Bild und Zugehördt in billigem Preis, im Berichtshaus zu erfragen."
},
{
"date": "1731-01-02",
"tags_section": "Es werden zu Entleihen begehrt",
